INSERT INTO `album` (`id_album`, `jdl_album`, `album_seo`, `keterangan`, `gbr_album`, `aktif`, `hits_album`, `tgl_posting`, `jam`, `hari`, `username`) VALUES
(2, 'Kegiatan Purnama dan Tilem', 'kegiatan-purnama-dan-tilem', '<p>Setiap hari purnama dan tilem seluruh guru, pegawai dan peserta didik SMAS Dharma Kirti Sengkidu melaksanakan persembahyangan bersama</p>\r\n', 'kegiatan-purnama.jpg', 'Y', 113, '2023-05-06', '14:41:41', 'Sabtu', 'adminsdk'),
(3, 'Bulan Bahasa Bali 2023', 'bulan-bahasa-bali-2023', '<p>Pelaksanaan Bulan Bahasa Bali di Smas Dharma Kirti Sengkidu tahun 2023 yang menyelenggarakan berbagai kegiatan lomba seperti lomba&nbsp;busana adat ke pura, membaca puisi bali, drama bali dan nyurat aksara bali</p>\r\n', 'WhatsApp-Image-2023-02-24-at-22_22_18.jpg', 'Y', 120, '2023-05-06', '14:55:40', 'Sabtu', 'adminsdk'),
(4, 'Kegiatan OSNK tingkat Kabupaten', 'kegiatan-osnk-tingkat-kabupaten', '<p>Kegiatan OSNK tingkat Kabupaten SMAS Dharma Kirti ikut berpartisipasi dalam kegiatan lomba mata pelajaran yang diikuti siswa yang berjumlah 18 peserta untuk 9 mapel yang dilombakan</p>\r\n', 'WhatsApp-Image-2023-05-06-at-00_16_30.jpg', 'Y', 77, '2023-05-06', '15:20:38', 'Sabtu', 'adminsdk'),
(5, 'Kegiatan Proses Belajar Mengajar', 'kegiatan-proses-belajar-mengajar', '<p>Kegiatan proses belajar mengajar di SMAS Dharma Kirti sengkidu dilaksanakan selama 6 hari kerja dengan memakai fasilitas LCD untuk mendukung kegiatan mengajar</p>\r\n', 'WhatsApp-Image-2023-05-06-at-00_59_34.jpg', 'Y', 96, '2023-05-06', '17:09:23', 'Sabtu', 'adminsdk'),
(6, 'Lmba KSN-K Tingkat Provinsi', 'lmba-ksnk-tingkat-provinsi', '<p>Kegiatan lomba KSN-K tingkat Provinsi yang diselenggarakan pada tanggal 06 Juni 2023</p>\r\n', 'WhatsApp_Image_2023-06-05_at_19_08_28.jpg', 'Y', 23, '2023-06-06', '16:30:01', 'Selasa', 'adminsdk'),
(7, 'Kegiatan Saraswati di SMAS Dharma Kirti Sengkidu', 'kegiatan-saraswati-di-smas-dharma-kirti-sengkidu', '<p>Kegiatan perayaan Hari raya Saraswati yang berlangsung pada tanggal 20 Mei 2023 di SMAS Dharma Kirti Sengkidu yang dihadiri oleh Kepala SMAS Dharma Kirti Sengkidu, Dewan guru dan staf pegawai dan juga seluruh peserta didik SMAS Dharma Kirti Sengkidu.</p>\r\n', 'WhatsApp_Image_2023-06-06_at_01_43_11.jpg', 'Y', 91, '2023-06-06', '17:22:46', 'Selasa', 'adminsdk'),
(8, 'Kegiatan Pembagian Raport Tapel 2022/2023', 'kegiatan-pembagian-raport-tapel-20222023', '<p>Pelaksanaan pembagian raport tahun ajaran 2022/ 2023 dilakasanakan pada tanggal 10 juni 2023 yang bertempat di Bukit Asah Desa Bugbug.</p>\r\n', 'WhatsApp_Image_2023-06-09_at_18_44_18.jpg', 'Y', 229, '2023-06-10', '14:52:29', 'Sabtu', 'adminsdk'),
(9, 'Kegiatan Pasraman Kilat Tanggal 19 Juni 2023', 'kegiatan-pasraman-kilat-tanggal-19-juni-2023', '<p>Kegiatan pasraman kilat hari senin, 19 Juni 2023 peserta didik kelas 11 yang perempuan membuat canang sari dan untuk peserta didik yang laki- laki membuat sengkui. Kegiatan tersebut didampingi oleh guru guru di SMAS Dharma Kirti Sengkidu</p>\r\n', 'WhatsApp_Image_2023-06-18_at_17_48_37.jpg', 'Y', 173, '2023-06-19', '18:10:57', 'Senin', 'adminsdk'),
(10, 'Kegiatan Pasraman Kilat Tanggal 20 Juni 2023', 'kegiatan-pasraman-kilat-tanggal-20-juni-2023', '<p>Kegiatan pasraman kilat diisi dengan membuat berbagai anyaman ketupat dari daun kelapa yang diikuti oleh peserta didik kelas 12.</p>\r\n', 'WhatsApp_Image_2023-06-19_at_16_27_15.jpg', 'Y', 84, '2023-06-20', '17:39:14', 'Selasa', 'adminsdk'),
(11, 'Workshop Implementasi Kurikulum Merdeka', 'workshop-implementasi-kurikulum-merdeka', '<p>Kegiatan Workshop diselenggarakan dari tanggal 23,24 dan 26 Juni 2023 di SMAS Dharma Kirti Sengkidu</p>\r\n', 'WhatsApp_Image_2023-06-22_at_22_04_49.jpg', 'Y', 105, '2023-06-23', '17:32:17', 'Jumat', 'adminsdk');
