INSERT INTO `berita` (`id_berita`, `id_kategori`, `username`, `judul`, `sub_judul`, `youtube`, `judul_seo`, `headline`, `aktif`, `utama`, `isi_berita`, `keterangan_gambar`, `hari`, `tanggal`, `jam`, `gambar`, `dibaca`, `tag`, `status`) VALUES
(4, 1, 'adminsdk', 'Pelepasan Siswa Kelas 12', 'Graduation', '', 'pelepasan-siswa-kelas-12', 'N', 'N', 'N', '<p>Kegiatan pelepasan peserta didik kelas 12 yang berjumlah 66 orang dari jurusan MIPA 31 orang dan dari jurusan IPS 35 orang yang dilaksanakan pada tanggal 15 April 2023.&nbsp;</p>\r\n', 'Guru&Pegawai beserta seluruh siswa kelas 12 SMAS Dharma Kirti Sengkidu', 'Senin', '2023-05-08', '20:06:58', 'WhatsApp_Image_2023-05-06_at_03_32_38-transformed.jpg', 58, 'google,smas-dharma-kirti,smasdharmakirti', 'Y'),
(5, 1, 'adminsdk', 'Program Plus Pariwisata', 'Program Perhotelan', '', 'program-plus-pariwisata', 'N', 'N', 'N', '<p>SMAS Dharma Kirti Sengkidu juga mengembangkan life skill/kecakapan hidup yaitu program plus pariwisata diantaranya: kantor depan, tata hidang, tata boga dan tata graha.</p>\r\n', 'Making bed ', 'Senin', '2023-05-08', '00:31:59', 'WhatsApp_Image_2023-05-06_at_03_53_59-transformed.jpg', 96, 'google', 'Y'),
(6, 1, 'adminsdk', 'Penerimaan Siswa Baru', ' PPDB 2023/2024', '', 'penerimaan-siswa-baru', 'Y', 'N', 'N', '<p>SMAS Dharma Kirti Sengkidu menerima pendaftaran peserta didik baru tahun pelajaran 2023/2024. Dengan ketentuan dan syarat pendaftaran sebagai berikut :</p>\r\n\r\n<p>1. Foto Kopi KK (2 lembar)</p>\r\n\r\n<p>2. Foto Kopi Akte Kelahiran (2 lembar)</p>\r\n\r\n<p>3. Foto Kopi Ijazah (2 lembar)</p>\r\n\r\n<p>4. Foto bewarna 3X4 (4 Lembar)</p>\r\n\r\n<p>Semua syarat diatas dijadikan dalam 1 map berwarna merah.</p>\r\n\r\n<p>Untuk pendaftaran bisa dimulai bulan Juni 2023.</p>\r\n\r\n<p>Untuk Info lebih lanjut bisa menghubungi kontak : 087 762 706 580/ 081 936 315 070/ 083 119 893 655</p>\r\n', '', 'Senin', '2023-05-08', '20:07:05', 'WhatsApp_Image_2023-05-08_at_09_12_31.jpg', 74, 'google', 'Y'),
(7, 1, 'adminsdk', 'Kegiatan Lomba KSN-K tingkat Provinsi', 'Lomba KSN-K Tingkat Provinsi', '', 'kegiatan-lomba-ksnk-tingkat-provinsi', 'N', 'N', 'N', '<p>Kegiatan lomba KSN-K tingkat provinsi yang dilaksanakan pada tanggal 6 Juni 2023. Tiga siswa SMAS Dharma Kirti lolos ditingkat kabupaten dengan mata pelajaran Kimia 2 orang atas nama Ni Komang Dewi Dianawati (X A) dan Ni Kadek Rediasih (XI MIPA) dan 1 orang untuk mapel Geografi atas nama Ni Komang Ayu Septiani (X A)</p>\r\n', '', 'Selasa', '2023-06-06', '16:26:55', 'WhatsApp_Image_2023-06-05_at_19_08_28.jpg', 54, 'google', 'Y'),
(8, 1, 'adminsdk', 'Pembagian Raport Semester 2 Tahun Pelajaran 2022/2023', 'Kegiatan Pembagian Raport', '', 'pembagian-raport-semester-2-tahun-pelajaran-20222023', 'N', 'N', 'N', '<p>Pelaksanaan pembagian raport tahun ajaran 2022/2023 SMAS Dharma Kirti Sengkidu dilaksanakan di salah satu obyek wisata di Karangasem tepatnya di Bukit Asah desa Bugbug. Acara pembagian raport dihadiri oleh kepala sekolah, dewan guru dan staf pegawai serta seluruh peserta didik SMAS Dharma Kirti Sengkidu.</p>\r\n', 'Kepala sekolah,guru/pegawai dan siswa SMAS Dharma Kirti', 'Sabtu', '2023-06-10', '14:49:55', 'WhatsApp_Image_2023-06-09_at_18_44_18.jpg', 73, 'google', 'Y'),
(9, 1, 'adminsdk', 'Kegiatan Pasraman Kilat', 'Pasraman Kilat', '', 'kegiatan-pasraman-kilat', 'N', 'N', 'N', '<p>Kegiatan pasraman kilat di SMAS Dharma Kirti Sengkidu dilaksanakan pada tanggal 19 dan 20 Juni 2023. Kegiatan pasraman kilat dibuka langsung oleh Kepala SMAS Dharma Kirti Sengkidu Drs. I Wayan Nomer dengan didampingi oleh pendidik dan staf pegawai SMAS Dharma Kirti Sengkidu.</p>\r\n', 'Kepala SMAS Dharma Kirti Sengkidu membuka kegiatan pasraman kilat', 'Senin', '2023-06-19', '18:03:06', 'WhatsApp_Image_2023-06-19_at_02_56_55.jpg', 0, 'google', 'Y'),
(10, 1, 'adminsdk', 'Kegiatan Pasraman Kilat', 'Pasraman Kilat Hari Kedua', '', 'kegiatan-pasraman-kilat', 'N', 'N', 'N', '<p>Kegiatan pasraman kilat hari selasa 20 Juni 2023 diikuti oleh peserta didik kelas 12. kegiatan tersebut diisi dengan membuat berbagai anyaman ketupat dari daun kelapa.</p>\r\n', '', 'Selasa', '2023-06-20', '17:35:25', 'WhatsApp_Image_2023-06-19_at_16_27_17.jpg', 62, '', 'Y'),
(11, 1, 'adminsdk', 'Workshop Implementasi Kurikulum Merdeka', 'Workshop IKM', '', 'workshop-implementasi-kurikulum-merdeka', 'N', 'N', 'N', '<p>Kegiatan workshop di SMAS Dharma Kirti Sengkidu diselenggarakan dari tanggal 23,24 dan 26 Juni 2023. Kegiatan workshop tersebut mengundang bapak pengawas menejerial sekolah&nbsp; untuk mengisi materi didalam kegiatan workshop yang didampingi oleh&nbsp;kepala sekolah dan diikuti oleh seluruh pendidik dan staf pegawai SMAS Dharma Kirti Sengkidu</p>\r\n', '', 'Jumat', '2023-06-23', '17:30:09', 'WhatsApp_Image_2023-06-22_at_22_04_48.jpg', 60, '', 'Y');
