INSERT INTO `halamanstatis` (`id_halaman`, `judul`, `judul_seo`, `isi_halaman`, `tgl_posting`, `gambar`, `username`, `dibaca`, `jam`, `hari`, `urutan`, `kelompok`) VALUES
(54, 'Fasilitas Ekstra Seni & Olahraga', 'fasilitas-ekstra-seni--olahraga', '<p>Fasilitas ekstra seni &amp; olahraga :</p>\r\n\r\n<ol>\r\n	<li>Seperangkat Bleganjur</li>\r\n	<li>Seperangkat Gambelan Geguntangan</li>\r\n	<li>Perangkat Musik ( 6 Buah Gitar, 1 Set Angklung, Seruling Bambu, Ketipung, Piano dsb)</li>\r\n	<li>Pakaian Penari Cendrawasih</li>\r\n	<li>Meja Tenis lengkap dengan Bat</li>\r\n	<li>Peralatan Permainan Bola Voli</li>\r\n	<li>Peralatan Atletik</li>\r\n	<li>Peralatan Batminton</li>\r\n	<li>Peralatan Pariwisata &amp; Perhotelan</li>\r\n</ol>\r\n', '2023-04-30', '', 'adminsdk', 53, '04:15:52', 'Minggu', 3, 2),
(5, 'Struktur Organisasi', 'struktur-organisasi', '<p style=\"text-align:center\"><strong>Struktur Organisasi di SMAS Dharma Kirti</strong></p>\r\n', '2023-05-02', 'IMG-20230317-WA0011.jpg', 'adminsdk', 65, '10:00:00', 'Minggu', 3, 1),
(1, 'Sejarah Sekolah', 'sejarah-sekolah', '<p>&nbsp;</p>\r\n\r\n<p><strong>SMA Dharma Kirti</strong> berdiri sejak tanggal 20 Juli 1987 dengan bernaung&nbsp; di bawa Panji Yayasan Pendidikan Dharma Kirti dengan badan pendiri beranggotakan 7 (tujuh) Desa Pekraman yaitu :</p>\r\n\r\n<ol>\r\n	<li>Desa Pekraman Tenganan Pegringsingan</li>\r\n	<li>Desa Pekraman Tenganan Dauh Tukad</li>\r\n	<li>Desa Pekraman Pesedahan</li>\r\n	<li>Desa Pekraman Nyuhtebel</li>\r\n	<li>Desa Pekraman Sengkidu</li>\r\n	<li>Desa Pekraman Pekarangan</li>\r\n	<li>Desa Pekraman Ngis</li>\r\n</ol>\r\n\r\n<p>Dengan Akta Pendirian No. 30 tahun 1977. Sekolah ini merupakan Perguruan Swasta satu-satunya&nbsp; yang ada di Kecamatan Manggis. Sekolah ini telah memiliki gedung sendiri di atas tanah milik Desa Pekraman Sengkidu dengan Hak Guna Pakai.</p>\r\n\r\n<p>Mengkondisikan perkembangan ilmu pengetahuan dan teknologi telah mendorong masyarakat menyadari tentang arti penting dalam mewujudkan dan meyukseskan <strong>Program Wajib Belajar&nbsp;Duabelas Tahun.&nbsp;</strong>Tanggap dan peka teradap permasalahan di atas, Yayasan Pendidikan Dharma Kirti merasa terpanggil untuk berperan aktif dalam mewujudkan pendidikan.</p>\r\n', '2023-05-02', '277841218_667851111167069_8827010250066491992_n.jpg', 'adminsdk', 98, '10:00:00', 'Senin', 1, 1),
(53, 'Bangunan Lainnya', 'bangunan-lainnya', '<p>Fasilitas lainnya seperti :</p>\r\n\r\n<ol>\r\n	<li>Laboratorium IPA</li>\r\n	<li>Perpustakaan</li>\r\n	<li>Ruang Ketrampilan</li>\r\n	<li>Kamar Mandi Guru &amp; Kamar Mandi Siswa</li>\r\n</ol>\r\n', '2023-04-30', '', 'adminsdk', 53, '04:14:13', 'Minggu', 2, 2),
(3, 'Visi dan Misi', 'visi-dan-misi', '<p>&nbsp;</p>\r\n\r\n<h3>Di era globalisasi ini, SMA Dharma Kirti memiliki Visi <strong>Berprestasi, Berbudaya, Beriman dan Bertaqwa.&nbsp;</strong></h3>\r\n\r\n<h3>Untuk mencapai visi tersebut SMA Dharma Kirti mengembangkan Misi :</h3>\r\n\r\n<ol>\r\n	<li>\r\n	<h3>Melaksanakan pembelajaran secara optional</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Menambah dan memberikan <em>Life Skill&nbsp;</em>/ Ketrampilan di bidang perhotelan / pariwisata melalui <em>Job Training&nbsp;</em>di hotel - hotel</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Meningkatkan extra kurikuler yang menunjang prestasi</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Meningkatkan lingkungan yang kondusif dan bernuansa budaya</h3>\r\n	</li>\r\n</ol>\r\n\r\n<h3>Tujuan Pendidikan, Menghasilkan lulusan yang berkompetensi sesuai tuntutan zaman dalam menyongsong era globalisasi</h3>\r\n', '2023-05-02', '241736897_541036546974352_3149309498408286375_n1.jpg', 'adminsdk', 65, '10:00:00', 'Minggu', 2, 1),
(8, 'Program Sekolah', 'program-sekolah', '<h3>&nbsp;</h3>\r\n\r\n<h2><strong>Program pendidikan yang ditawarkan di SMAS Dharma Kirti :</strong></h2>\r\n\r\n<ol>\r\n	<li>\r\n	<h2>Perhotelan</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Komputer</h2>\r\n	</li>\r\n	<li>\r\n	<h2>English Plus</h2>\r\n	</li>\r\n</ol>\r\n', '2023-05-02', '252082473_781498385895578_4163901358296737564_n1.jpg', 'adminsdk', 64, '10:00:00', 'Minggu', 6, 1),
(9, 'Prestasi Sekolah', 'prestasi-sekolah', '<p>&nbsp;</p>\r\n\r\n<h1><strong>Prestasi Akademik dan Olahraga</strong></h1>\r\n\r\n<ol>\r\n	<li>\r\n	<h3>Tahun 1994/1995 Juara II Lomba Coba Terka Tingkat SMTA di TVRI Denpasar</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Tahun 1994 Juara I Lomba Seni Tingkat Kabupaten</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Tahun 1998 Juara III Melukis Tingkat Kabupaten</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Tahun 2007 Juara I Puisi Tingkat Kabupaten</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Tahun 2007 Juara III Pidato Tingkat Kabupaten</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Juara III Olimpiade Sains Tingkat Kabupaten Karangasem Bidang Komputer Tahun 2017</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Prestasi Olahraga di tingkat Kabupaten cukup banyak meraih prestasi di bidang atletik, voli, dan tenis meja baik berupa tropi maupun piagam penghargaan tidak bisa kamu sebutkan satu persatu.</h3>\r\n	</li>\r\n</ol>\r\n', '2023-05-02', '74534346_510344373081040_998636630327641644_n.jpg', 'adminsdk', 62, '10:00:00', 'Minggu', 7, 1),
(55, 'Fasilitas Kegiatan Belajar Mengajar', 'fasilitas-kegiatan-belajar-mengajar', '<p>Fasilitas kegiatan untuk mendukung proses belajar mengajar lainnya :</p>\r\n\r\n<ol>\r\n	<li>OHP</li>\r\n	<li>Mikroskop</li>\r\n	<li>Timbangan dilengkapi pengukur tinggi badan</li>\r\n	<li>Perangkat wireless</li>\r\n	<li>Komputer &amp; Laptop</li>\r\n	<li>LCD</li>\r\n	<li>Layar Proyektor</li>\r\n	<li>Internet Wifi</li>\r\n</ol>\r\n', '2023-04-30', '', 'adminsdk', 51, '04:23:16', 'Minggu', 4, 2),
(18, 'Sambutan Kepala Sekolah SMAS Darma Kirti Sengkidu Karangasem Bali', 'sambutan-kepala-sekolah-smas-darma-kirti-sengkidu-karangasem-bali', '<p><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Om Swastiastu</span></span></strong></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Assalamualaikum Warahmatullahi Wabarakatuh</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Namo Budaya</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Salam Kebajikan</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Rahayu untuk kita semua</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Yang Terhormat Bapak Ketua Yayasan Pendidikan Dharma Kirti Sengkidu</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Yang Saya Hormati Bapak Ketua Komite SMAS Dharma Kirti Sengkidu</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Yang Saya Hormati Bapak/ Ibu Dewan Guru dan Staff Pegawai SMAS Dharma Kirti Sengkidu</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Yang Saya Hormati para pemangku kepentingan dan kepada para siswa/ siswi SMAS Dharma Kirti Sengkidu yang berbahagia dan saya banggakan</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Puji syukur kita panjatkan kehadapan Tuhan Yang Maha Esa, karena atas rahmatNya kita telah diberikan keselamatan serta kesehatan sampai saat ini, dalam mengemban Amanah dunia Pendidikan yang merupakan sebuah visi, misi dan tujuan Pendidikan di SMAS Dharma Kirti Sengkidu, maka kami memiliki kewajiban untuk menjalankan segala upaya yang menjadi prinsip bagi kepentingan Pendidikan untuk menunjukkan kewajiban serta perkembangan sesuai kebutuhan maupun tuntutan pemerintah dan masyarakat yang dikombinasikan dengan pembelajaran life skill yaitu sebuah keterampilan/ kecakapan hidup yang nantinya tamatan/ output&nbsp; SMAS Dharma Kirti&nbsp; Sengkidu dapat bersaing setelah berbaur di masyarakat, pada dunia Pendidikan yang lebih tinggi ( perguruan tinggi) ataupun dalam dunia usaha dan industri sesuai dengan perkembangan di zaman globalisasi serta IPTEK. Disamping itu SMAS Dharma Kirti Sengkidu tidak akan mengurangi proses belajar mengajar yang ditetapkan oleh pemerintah baik Kurikum K13 maupun Kurikulum Merdeka yang berlaku saat ini. </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">SMAS Dharma Kirti Sengkidu selalu berusaha dan mendorong dalam pemenuhan kebutuhan terutama dalam proses pembelajaran baik sarana, prasarana ataupun sebuah prestasi dan prestise yang nantinya berakibat kepada lulusan/ tamatan yang mumpuni untuk menjadi sebuah impian bagi peserta didik/ tenaga pendidik/ tenaga kependidikan agar SMAS Dharma Kirti Sengkidu diminati oleh masyarakat.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Demikian sambutan kami, semoga bermanfaat bagi kita lebih- lebih dalam mengejar sebuah cita- cita didalam memenuhi kebutuhan masyarakat sesuai dengan perkembangan zaman globalisasi serta dapat terwujudnya sebuah Pendidikan yang Amanah untuk menuju masyarakat atau bangsa yang cerdas demi menatap masa depan yang lebih kompetitif kurang lebih mohon maaf. </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Kami akhiri dengan paramashanti</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Om Shanti, Shanti, Shanti OM</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"background-color:white\"><span style=\"color:black\">Wassalamualaikum Warrahmatullahi Wabarakatuh</span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"background-color:white\"><span style=\"color:black\">Namo Budaya</span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"background-color:white\"><span style=\"color:black\">Salam Kebajikan</span></span></span><br />\r\n&nbsp;</p>\r\n', '2023-05-02', 'Kepsek.jpg', 'adminsdk', 90, '10:00:00', 'Senin', 1, 0),
(52, 'Fasilitas Gedung Lantai 2', 'fasilitas-gedung-lantai-2', '<p>Gedung berlantai 2 (dua) dilengkapi :</p>\r\n\r\n<ol>\r\n	<li>Ruang Belajar 11 Ruangan</li>\r\n	<li>Ruang Administrasi</li>\r\n	<li>Ruang Aula</li>\r\n	<li>Ruang Kepala Sekolah</li>\r\n	<li>Ruang Guru</li>\r\n	<li>Ruang Komputer</li>\r\n</ol>\r\n', '2023-04-30', '', 'adminsdk', 60, '04:12:12', 'Minggu', 1, 2),
(57, 'Penerimaan Siswa Baru', 'penerimaan-siswa-baru', '<p>SMAS Dharma Kirti Sengkidu menerima pendaftaran peserta didik baru tahun pelajaran 2023/2024. Dengan ketentuan dan syarat pendaftaran sebagai berikut :</p>\r\n\r\n<p>1. Foto Kopi KK (2 lembar)</p>\r\n\r\n<p>2. Foto Kopi Akte Kelahiran (2 lembar)</p>\r\n\r\n<p>3. Foto Kopi Ijazah (2 lembar)</p>\r\n\r\n<p>4. Foto bewarna 3X4 (4 Lembar)</p>\r\n\r\n<p>Semua syarat diatas dijadikan dalam 1 map berwarna merah.</p>\r\n\r\n<p>Untuk pendaftaran bisa dimulai bulan Juni 2023.</p>\r\n\r\n<p>Untuk Info lebih lanjut bisa menghubungi kontak : 087 762 706 580/ 081 936 315 070/ 083 119 893 655</p>\r\n', '2023-05-08', 'Pendaftaran.jpg', 'adminsdk', 102, '19:44:22', 'Senin', 0, 3);
